import Layout from '../components/MyLayout';

const Index = props => (
    <Layout>
        <h1>Data Mining</h1>
        <p>Data Mining adalah proses yang menggunakan teknik statistik, matematika, kecerdasan buatan, 
            machine learning untuk mengekstraksi dan mengidentifikasi informasi yang bermanfaat dan 
            pengetahuan yang terkait dari berbagai database besar (Turban dkk. 2005). 
            Terdapat beberapa istilah lain yang memiliki makna sama dengan data mining, yaitu Knowledge discovery in databases (KDD), 
            ekstraksi pengetahuan (knowledge extraction), Analisa data/pola (data/pattern analysis), 
            kecerdasan bisnis (business intelligence) dan data archaeology dan data dredging (Larose, 2005)</p>
    </Layout>
);

export default Index;
